import React from 'react';
import ThemeToggle from '../components/ThemeToggle';

const Settings = () => {
  return (
    <div className="p-6 bg-white dark:bg-gray-800 rounded-lg shadow-md">
      <h1 className="text-2xl font-bold mb-4 text-gray-900 dark:text-white">Settings</h1>
      <div className="mb-4">
        <h2 className="text-lg font-semibold text-gray-800 dark:text-gray-200">Theme</h2>
        <ThemeToggle />
      </div>
      <div>
        <h2 className="text-lg font-semibold text-gray-800 dark:text-gray-200">Profile</h2>
        <p className="text-gray-700 dark:text-gray-300">Profile management features coming soon.</p>
      </div>
    </div>
  );
};

export default Settings;
